import React from "react";
import styles from "../styles/ProjectLists.module.css";
import ProjectBox from "./ProjectBox";

export default function ProjectLists() {
  return (
    <div
      style={{
        marginTop: "100px",
        display: "flex",
        gap: "30px",
        justifyContent: "center",
      }}
    >
      <div className={styles.flexCol1}>
        <ProjectBox />
        <ProjectBox />
        <ProjectBox />
      </div>
      <div className={styles.flexCol2}>
        <ProjectBox />
        <ProjectBox />
        <ProjectBox />
      </div>
      <div className={styles.flexCol1}>
        <ProjectBox />
        <ProjectBox />
        <ProjectBox />
      </div>
    </div>
  );
}
